import styled from "styled-components";

const Wrapper=styled.div`
  border: 1px solid red;
  width: 100%;
  height: 80px;
`;
const Box=styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
`
const Text=styled.h2`

`

const Navbar = () => {
  return (
    <Wrapper>
      <Box>
        <Text>Marriage Portal</Text>
      </Box>
    </Wrapper>
  )
}

export default Navbar
